from UI.login import login

def test_login(page):#  EZX admin登录到Store选择界面
    login(page, "mingv", "qwer`1234")
    content = page.text_content(".ant-message-notice-content")# 定位反馈气泡
    print("\ntest_login")
    if content == "Login Successful!":
        print("\tSuccess")
    else:
        print("\tFail")
        page.pause()
    assert content == "Login Successful!"#  断言反馈气泡结果

def test_loginEzx(page):
    login(page, username="mingv", password="qwer`1234")
    # Click text=EZX># with page.expect_navigation(url="http://ezx-admin.test.ezx.com.my/user-management"):
    with page.expect_navigation():
        page.locator("text=EZX>").click()
    # Click h1:has-text("EZX")
    # page.locator("h1:has-text(\"EZX\")").click()
    with page.expect_navigation():
    #   断言
    #定位logo图片信息
        href_element = page.locator("#root > div > section > div.ant-layout > header.ant-layout-header.ant-pro-fixed-header.ant-pro-fixed-header-action > div > div.ant-pro-global-header-logo > a > img")
    # print("href_element:",href_element)
    href_src = href_element.get_attribute("src")                                 
    # print("src:",href_src)
    print("\ntest_loginEzx")
    if href_src == "/static/logo.735d462b.png":
        print("\tSuccess")
    else:
        print("\tFail")   
    assert href_src == "/static/logo.735d462b.png"

